import { Table, Button} from "reactstrap";

class Cart extends Component {
    render() {
        return (
            <div className="cart">
                <Table>
                    <thead>
                    <tr>
                        <th>#</th>
                        <th>Product Name</th>
                        <th>Quantity Per Unit</th>
                        <th>Price</th>
                        <th>Units In Stock</th>
                        <th>Cart</th>
                    </tr>
                    </thead>
                    <tbody>
                    
                    </tbody>
                </Table>
            </div>
        );
    }
}

export default Cart;
